import React,{useState} from 'react';
import './Aboutme.css';

export default function Aboutme() {
  const [backcolor,setbackcolor]=useState('white');
  const [textcolor,settextcolor]=useState(' rgb(32, 42, 68);');
  const changeedu = () =>{
      setbackcolor('rgb(27,28,58)');
      settextcolor('white');
  }
  const changeintern = () =>{
    setbackcolor('rgb(27,28,58)');
    settextcolor('white');
  }
  const changeproj = () =>{
    setbackcolor('rgb(27,28,58)');
    settextcolor('white');
  }
  const changeachiv = () =>{
    setbackcolor('rgb(27,28,58)');
    settextcolor('white');
  }
  const changeintere = () =>{
    setbackcolor('rgb(27,28,58)');
    settextcolor('white');
  }

  return (
    <div className='Aboutme-container'>
      <div className='Aboutme-heading'>
        <h1>Resume</h1>
        <p>My Formal Bio Details</p>
      </div>
      <div className='Aboutme-detail'>
       <div className='Education-border'>
         <li><i class="fa-solid fa-book-open"></i></li>
         <li><i class="fa-solid fa-clipboard"></i></li>
         <li><i class="fa-solid fa-chart-simple"></i></li>
         <li><i class="fa-solid fa-arrow-trend-up"></i></li>
         <li><i class="fa-solid fa-bookmark"></i></li>
       </div>
       <div className='Education-heading'>
          <li><button onClick={changeedu} style={{backgroundColor:backcolor,color:textcolor}}>Education</button></li>
          <li><button onClick={changeintern} style={{backgroundColor:backcolor,color:textcolor}}>Internship</button></li>
          <li><button onClick={changeproj} style={{backgroundColor:backcolor,color:textcolor}}>Projects</button></li>
          <li><button onClick={changeachiv} style={{backgroundColor:backcolor,color:textcolor}}>Achivements</button></li>
          <li><button onClick={changeintere} style={{backgroundColor:backcolor,color:textcolor}}>Interest</button></li>
        </div>
        <div className='Education-line'>

        </div>
        <div className='Education-information'>
          <h1>Dr. A.P.J. Abdul Kalam Technical University</h1>
          <h6>KIET Group of Institutions<span>B.Tech - Computer Science</span></h6>
          <p>2019 - present <span>- 85.25% </span></p>
          <h1>C.B.S.E Board </h1>
          <h6>C.S.H.P Memorial Public School<span> - 12th Standard</span></h6>
          <p>2018 - 2019 <span> - 89.8%</span></p>
          <h1>C.B.S.E Board</h1>
          <h6>C.S.H.P Memorial Public School<span> - 10th Standard</span></h6>
          <p>2016 - 2017 <span> - 10 CGPA </span></p>
        </div>
      </div>
    </div>
  )
}
